import React, { useState, useCallback, useRef } from 'react';
import { GoogleMap, useLoadScript } from '@react-google-maps/api';
import axios from 'axios';
import './MapComponent.css';

// Define libraries needed for Google Maps functionality
const libraries = ['drawing', 'places'];

const MapComponent = ({ onDispatchDrone }) => {
  // State management for various map interactions
  const [selectedArea, setSelectedArea] = useState(null);
  const [drawingManager, setDrawingManager] = useState(null);
  const [selectedLocation, setSelectedLocation] = useState(null);
  const [searchTerm, setSearchTerm] = useState(''); // Track search input text

  // Default map center coordinates
  const center = {
    lat: 17.39716,
    lng: 78.49040,
  };

  // Load Google Maps script with necessary libraries
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: 'AIzaSyB-6NuWru71NBpaRmAaiEZjRmTJnUfQBbQ',
    libraries,
  });

  // References for search box, map, and autocomplete
  const searchBoxRef = useRef(null);
  const mapRef = useRef(null);
  const autocompleteRef = useRef(null);

  // Map container style to fill entire container
  const mapContainerStyle = {
    width: '100%',
    height: '100%',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
  };

  // Detailed map options for customized view
  const mapOptions = {
    zoom: 18,
    center: center,
    mapTypeControl: false,
    streetViewControl: false,
    fullscreenControl: true,
    zoomControl: true,
  };

  // Initialize drawing manager for area selection
  const onLoad = useCallback((map) => {
    const drawingManagerInstance = new window.google.maps.drawing.DrawingManager({
      drawingMode: null,
      drawingControl: true,
      drawingControlOptions: {
        position: window.google.maps.ControlPosition.TOP_CENTER,
        drawingModes: [
          window.google.maps.drawing.OverlayType.RECTANGLE,
        ],
      },
    });

    drawingManagerInstance.setMap(map);
    setDrawingManager(drawingManagerInstance);

    // Listener for when a rectangle is drawn
    window.google.maps.event.addListener(drawingManagerInstance, 'rectanglecomplete', (rectangle) => {
      const bounds = rectangle.getBounds();
      const selectedBounds = bounds.toJSON();
      setSelectedArea(selectedBounds);
    });
  }, []);

  // Clean up drawing manager when component unmounts
  const onUnmount = useCallback(() => {
    if (drawingManager) {
      drawingManager.setMap(null);
    }
  }, [drawingManager]);

  // Set up Autocomplete for search functionality
  const handleSearch = useCallback(() => {
    if (searchBoxRef.current && !autocompleteRef.current) {
      // Create Autocomplete instance only once
      autocompleteRef.current = new window.google.maps.places.Autocomplete(
        searchBoxRef.current, 
        { types: ['geocode'] }
      );

      // Listener for when a place is selected
      autocompleteRef.current.addListener('place_changed', () => {
        const place = autocompleteRef.current.getPlace();
        if (place.geometry) {
          const { lat, lng } = place.geometry.location;
          setSelectedLocation({ lat: lat(), lng: lng() });
          // Pan map to selected location
          mapRef.current.panTo(place.geometry.location);
          // Clear search input after selection
          setSearchTerm('');
        } else {
          alert("No details available for the selected place.");
        }
      });
    }
  }, []);

  // Ensure Autocomplete is initialized when search input changes
  const handleSearchInputChange = (e) => {
    setSearchTerm(e.target.value);
    if (!autocompleteRef.current) {
      handleSearch(); // Initialize Autocomplete only if not already set up
    }
  };

  // Drone dispatch logic
  const handleDispatchDrone = async () => {
    if (selectedArea) {
      try {
        const requestData = {
          top_left: {
            latitude: parseFloat(selectedArea.north).toFixed(6),
            longitude: parseFloat(selectedArea.west).toFixed(6),
          },
          bottom_right: {
            latitude: parseFloat(selectedArea.south).toFixed(6),
            longitude: parseFloat(selectedArea.east).toFixed(6),
          },
        };

        const response = await axios.post('http://172.168.0.157:3001/drone/dispatch/rectangle', requestData);
        console.log('Drone dispatched:', response.data);
      } catch (error) {
        console.error('Error dispatching drone:', error);
        alert('Failed to dispatch drone');
      }
    } else {
      alert('No area selected');
    }
  };

  // Handle loading and error states
  if (loadError) {
    return <div className="map-error">Error loading maps</div>;
  }

  if (!isLoaded) {
    return <div className="map-loading">Loading maps...</div>;
  }

  return (
    <div className="map-wrapper">
      {/* Search input with controlled value */}
      <input
        ref={searchBoxRef}
        type="text"
        placeholder="Search a place"
        className="search-box"
        value={searchTerm} // Controlled input
        onChange={handleSearchInputChange} // Update search term as user types
      />

      {/* Google Map component */}
      <GoogleMap
        ref={mapRef}
        mapContainerStyle={mapContainerStyle}
        options={mapOptions}
        onLoad={onLoad}
        onUnmount={onUnmount}
        center={selectedLocation || center}
      >
      </GoogleMap>

      {/* Drone dispatch button appears when an area is selected */}
      {selectedArea && (
        <button onClick={handleDispatchDrone} className="dispatch-button">
          Dispatch Drone
        </button>
      )}
    </div>
  );
};

export default MapComponent;
